        "descriptionDe": "Thomas Zimmermann ist seit dem 1. April 2022 CEO von FREE NOW, Europas Super-App für Mobilität. Zuvor war er seit 2018 im Unternehmen als Chief Marketing Officer für die Kommunikations- und Marketingaktivitäten, die Marketplace Performance sowie die Data- und Growth Teams verantwortlich. Vor seiner Zeit bei FREE NOW war der studierte Diplom-Kaufmann unter anderem in verschiedenen Führungsfunktionen für den Company Builder und Investor Ioniq Group und den Online- und Mobile-Games-Entwickler Goodgame Studios tätig.",
