        "name": "Oliver Mackprang",
        "descriptionDe": "Seit über zehn Jahren arbeitet Oliver Mackprang für die Mobilitätswende. Zunächst gründete er 2012 in Berlin CarJump, eine Aggregator-App für Carsharing-Anbieter, aus der später free2move hervorging. Nach Stationen bei der Unternehmensberatung Kearny und dem Ridepooling-Anbieter Moia ist Mackprang seit Herbst 2019 Chef des Berliner Carsharing-Anbieters Miles Mobility. Er spricht sich – wie zuletzt auch im FUTURE MOVES Podcast – klar für den Abbau von Privilegien aus, die privaten Pkw-Besitz befördern, und so faire Bedingungen für neue Player im Mobilitätssektor zu schaffen.",
        "descriptionEn": "Oliver Mackprang has been working for the mobility revolution for over ten years. In 2012, he founded CarJump in Berlin, an aggregator app for car sharing providers, which later became free2move. After holding positions at the management consultancy Kearny and the ridepooling provider Moia, Mackprang has been head of the Berlin-based carsharing provider Miles Mobility since fall 2019. As he did most recently in the FUTURE MOVES podcast, he is clearly in favor of dismantling privileges that promote private car ownership and thus creating fair conditions for new players in the mobility sector.",
