        "name": "Christian Lindener",
        "descriptionDe": "Christian Lindener ist Mitgründer von Reflex Aerospace, einem in München ansässigen Unternehmen, das die weltweit modernsten digitalisierten Satelliten-Technologien entwickelt und herstellt. Das heißeste Projekt von Reflex Aerospace ist derzeit UN:IO, eine gemeinsame Initiative mit den StartUps Mynaric und ISAR Aerospace, um die Realisierung von Europas eigener sicherer Satellitenkonstellation voranzutreiben. Zuvor war Lindener Leiter von Airbus Scale, der zentralen Innovationseinheit von Airbus. In dieser Funktion hat er die internen und externen Innovationsaktivitäten des Unternehmens geleitet und vorangetrieben.",
        "descriptionEn": "Christian Lindener is co-founder of Reflex Aerospace, a Munich-based company that develops and manufactures the world's most advanced digitized satellite technologies. Reflex Aerospace's hottest project at the moment is UN:IO, a joint initiative with startups Mynaric and ISAR Aerospace to drive the realization of Europe's own secure satellite constellation. Previously, Lindener was head of Airbus Scale, Airbus' central innovation unit. In this role, he led and drove the company's internal and external innovation activities.",
