        "name": "Anna-Theresa Korbutt",
        "descriptionDe": "Nach Stationen unter anderem bei der Deutschen Bahn und den Österreichischen Bundesbahnen ist Anna-Theresa Korbutt seit April 2021 Geschäftsführerin des Hamburger Verkehrsverbunds (hvv). Klarer Auftrag: die Mobilitätswende tüchtig beschleunigen. Das zeigt sich nicht nur durch ein komplettes Redesign, eine neue App und innovative Tarif-Ideen, die dem ältesten Verkehrsverbund der Welt in den vergangenen Monaten verpasst wurden. Korbutt treibt die Verkehrswende-Debatte auch auf LinkedIn mit transparenten und persönlichen Einblicken in ihre Arbeit voran. ",
        "descriptionEn": "After holding positions at Deutsche Bahn and Austrian Railways, among others, Anna-Theresa Korbutt has been Managing Director of the Hamburg Transport Association (hvv) since April 2021. Her clear mission is to accelerate the mobility revolution. This is evident not only in a complete redesign, a new app and innovative fare ideas that have been given to the world's oldest transport association in recent months. Korbutt is also driving the transportation turnaround debate on LinkedIn with transparent and personal insights into her work. ",
