        "descriptionDe": "Henrik Wenders verbindet eine lange Geschichte mit den Themen Elektromobilität und Digitalisierung. Ehe er im April 2020 globaler CMO der AUDI AG wurde, arbeitete er von 2002 bis 2016 für BMW, wo er zuletzt als Vice President Produktmanagement für die Elektrosparte BMW i zuständig war. Dann zog es Wenders zur heutigen Byton Ltd. Innerhalb von drei Jahren baute er mit Teams in China, Europa und USA Byton zum globalen vollelektrischen Premium-Anbieter auf. Der perfekte Macher also, um die Transformation von Audi zur Elektromarke voranzutreiben.",
        "descriptionEn": "Henrik Wenders has a long history with the topics of electromobility and digitalization. Before becoming global CMO of AUDI AG in April 2020, he worked for BMW from 2002 to 2016, where he was most recently Vice President Product Management for the BMW i electric division. Then Wenders was drawn to what is now Byton Ltd. Within three years, he built Byton into a global all-electric premium provider with teams in China, Europe and the USA. The perfect man to drive Audi's transformation into an electric brand.",
