        "name": "Taco Carlier",
        "descriptionDe": "Taco Carlier gründete 2009 zusammen mit Ties Carlier die niederländische E-Bike-Marke VanMoof. Die beiden Brüder erträumten das perfekte Stadtrad. Heute bieten die schnittigen, mehrfach preisgekrönten E-Bikes ein hochtechnologisches und funktionsreiches Erlebnis für weltweite fast 200.000+ Fahrer:innen. Die D2C-Brand VanMoof verkauft seine E-Bikes online und unterhält Markenläden in über 20 Städten weltweit. Und die E-Bike-Pioniere stehen erst am Anfang. Als die am schnellsten wachsende und am besten finanzierte E-Bike-Marke der Welt ist VanMoof auf dem besten Weg, die Zukunft der urbanen Mobilität neu zu definieren und die nächste Milliarde Menschen aufs Rad zu bringen.",
        "descriptionEn": "Taco Carlier founded the dutch e-bike brand VanMoof together with Ties Carlier in 2009, the two brothers who dreamt up the perfect city bike. Today, its sleek, multi-award winning e-bikes offer a high-tech and feature-rich experience for a global community of almost 200,000+ riders. VanMoof sells its e-bikes directly to riders online, with Brand Stores in over 20 cities worldwide. And the e-bike pioneers are just getting started. As the world’s fastest growing and most well-funded e-bike brand, VanMoof is on course to redefine the future of urban mobility and get the next billion on bikes.",
