        "name": "Tony Fadell",
        "descriptionDe": "Tony Fadell is an active investor and entrepreneur with a 30+ year history of founding companies and designing products that profoundly improve people’s lives. He is the Principal at Future Shape, an investment and advisory firm coaching deep tech startups. Currently, Future Shape is coaching over 200+ startups innovating game-changing technologies. He is the founder and former CEO of Nest, the company that pioneered the “Internet of Things.” Tony was the SVP of Apple’s iPod Division and led the team that created the first 18 generations of the iPod and the first three generations of the iPhone. Throughout his career Tony has authored more than 300 patents. In May 2016, \"TIME\" named the Nest Learning Thermostat, the iPod and the iPhone as three of the \"50 Most Influential Gadgets of All Time\". He is the author of \"BUILD: An Unorthodox Guide to Making Things Worth Making\".",
        "descriptionEn": "Tony Fadell ist Investor und Unternehmer mit mehr als 30 Jahren Erfahrung in der Gründung von Unternehmen und der Entwicklung von Produkten, die das Leben der Menschen grundlegend verbessern. Er ist Principal bei Future Shape, einem Investment- und Beratungsunternehmen, das Start-ups im Bereich der Spitzentechnologie berät. Gegenwärtig betreut Future Shape mehr als 200 Start-ups, die bahnbrechende Technologien entwickeln. Er ist Gründer und ehemaliger CEO von Nest, dem Unternehmen, das Pionierarbeit für das \"Internet der Dinge\" geleistet hat. Tony war SVP der iPod Division von Apple und leitete das Team, das die ersten 18 Generationen des iPods und die ersten drei Generationen des iPhones entwickelte. Im Laufe seiner Karriere hat Tony mehr als 300 Patente angemeldet. Im Mai 2016 ernannte \"TIME\" den Nest Learning Thermostat, den iPod und das iPhone zu drei der \"50 einflussreichsten Gadgets aller Zeiten\". Er ist der Autor von \"BUILD: An Unorthodox Guide to Making Things Worth Making\".",
